        "db = drive.CreateFile({'id':'1oVGHlD3zDcS7k4IZ8_LJ6Qd43hES8izk'})\n",
        "db.GetContentFile('music_genre.csv')\n",
        "\n",
        "clf = drive.CreateFile({'id':'11JfjIOPG9dpanLyOu73UxbGRXDnY-MsJ'})\n",
